const { parseIcns, parseIcnsSync } = require('..');

test('parseIcns', async () => {
  const path = './test/test.icns';
  expect(await parseIcns(path)).toEqual(base64)
})

test('parseIcnsSync', () => {
  const path = './test/test.icns';
  expect(parseIcnsSync(path)).toEqual(base64)
})

